import React from 'react'
import Part from './Part'

const Content = (props) => {

    return (
        <>
            {props.course.parts.map((value, index) => {
                return <Part key={index} panamertName={value.name} exercisesNum={value.exercisesNum} />
            })}
        </>
    )
}

export default Content
